export const formInputs = {
  login: [
    { type: 'email', placeholder: '아이디' },
    { type: 'password', placeholder: '비밀번호' }
  ],
  signup: [
    { type: 'text', placeholder: '이름' },
    { type: 'email', placeholder: '이메일' },
    { type: 'tel', placeholder: '전화번호' },
    { type: 'password', placeholder: '비밀번호' }
  ],
  id: [
    { type: 'text', placeholder: '이름' },
    { type: 'tel', placeholder: '전화번호' },
    { type: 'email', placeholder: '이메일' }
  ],
  password: [
    { type: 'text', placeholder: '아이디' },
    { type: 'tel', placeholder: '전화번호' },
    { type: 'email', placeholder: '이메일' }
  ]
};
